import axios from "axios";
import { message } from "antd";

const service = axios.create({});

const serviceUtil = {
  post: function post(url, payload, headers, callback) {
    return new Promise(async (res, rej) => {
      try {
        await service.post(url, payload, headers);
        res(callback);
      } catch (error) {
        rej(error);
      }
    });
  },
  get: function get(url, headers, callback) {
    return new Promise(async (res, rej) => {
      try {
        await service.get(url, headers);
        res(callback);
      } catch (error) {
        rej(error);
      }
    });
  },
};

export default serviceUtil;
